import "MainPage.css";
function MainPage() {
    return(
        <main>
            <h2>Coś o nas</h2>
            <p>W samym sercu malowniczego miasteczka, tuż za rogiem głównego placu, znajduje się urokliwe miejsce, które wabi zarówno miłośników literatury, jak i kawy - Caffe de Mare. Ta wyjątkowa kawiarnia z biblioteką kryje w sobie nie tylko aromat świeżo parzonej kawy, ale także ckliwą historię, która sprawia, że każda wizyta staje się niezapomnianym doświadczeniem.</p>
            <h2>Historia tej kawiarni</h2>
            <p>Caffe de Mare powstało z pasji i miłości do książek oraz kawy, które połączyły się w niezwykły sposób. Wszystko zaczęło się wiele lat temu, gdy młoda bibliotekarka o imieniu Anna i barista Jakub spotkali się przypadkiem na miejskim targu książki. Anna, zaczytana w literaturze romantycznej, spostrzegła Jakuba, który z uśmiechem rozdawał darmowe próbki kawy. Ich spojrzenia się skrzyżowały, a serca zabiły mocniej. Wymienili kilka słów, a iskra między nimi zapłonęła jasnym płomieniem.</p>
            <p></p>
        </main>

    )
}

export default MainPage;
